import React, { Component, useState, useEffect } from "react";
import axios from "axios";
import Nav from 'react-bootstrap/Nav'
import { Upload, message } from 'antd';
import DataService from "../services/data.service"

const API_URL = "http://localhost:8080/";
const { Dragger } = Upload;


const BoardAdmin = () => {
    const [content, setContent] = useState(false);
    const [data, setData] = useState("")

    const props = {
        name: 'photo',
        multiple: false,
        action: 'http://localhost:8080/photo',
        onChange(info) {
            const { status } = info.file;
            if (status !== 'uploading') {
                console.log(info.file, info.fileList);
            }

            if (status === 'done') {
                message.success(`${info.file.name} file uploaded successfully.`);
            } else if (status === 'error') {
                message.error(`${info.file.name} file upload failed.`);
            }
        },
    };

    useEffect(() => {
        DataService.getAllRestaurant().then(
            (response) => {
                setData(response.data)
        })
    },[]);


    return (
            <div className="container">
              <Nav fill variant="tabs" defaultActiveKey="/home">
                <Nav.Item>
                    <Nav.Link href="/home" onClick={() => setContent(true)}>Active</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link onClick={() => setContent(false)}>Loooonger NavLink</Nav.Link>
                </Nav.Item>
                </Nav>
                {content ? 
                    <Dragger {...props}>
                        <div style={{width: '80%', height: '400px', backgroundColor:'blue'}}>
                            <p className="ant-upload-drag-icon">
                            </p>
                            <p className="ant-upload-text">Click or drag file to this area to upload</p>
                        </div>
                    </Dragger>
                 : 
                 <Dragger {...props}>
                    <div style={{width: '80%', height: '400px', backgroundColor:'blue'}}>
                        <p className="ant-upload-drag-icon">
                        </p>
                        <p className="ant-upload-text"> or drag file to this area to upload</p>
                    </div>
                </Dragger>}
            </div>
    )
}

export default BoardAdmin;


